import React, {useState} from 'react';
import './App.css';

const GIFS = ['https://media4.giphy.com/media/pO1H8mAU7geAw/giphy.gif?cid=ecf05e47q0jmkvkgmqe8ps46xtyuzk6dk6uh1kys8kzvx3r5&rid=giphy.gif&ct=g',
'https://media1.giphy.com/media/EPcvhM28ER9XW/giphy.gif?cid=ecf05e47hxr2148a74z0n62wiuvmdkeirr9if02d7bsv1tl3&rid=giphy.gif&ct=g'];

function App() {
  const [gifs, setGifs] = useState([GIFS])
  return (
    <div className="App">
      <section className="App-content">
        {
          gifs.map(singleGif => <img src={singleGif}/> )
        }

      </section>
    </div>
  );
}

export default App;
